import { calculatedActionTypes, store } from "../store";
import classes from "./Counter.module.css";

const Counter = () => {
  const { result } = store.getState();
  console.log(result);
  const addHandler = () => {
    store.dispatch({ type: calculatedActionTypes.ADD, payload: 20 });
  };
  const subtractHandler = () => {
    store.dispatch({ type: calculatedActionTypes.SUBTRACT, payload: 5 });
  };
  const multiplyHandler = () => {
    store.dispatch({ type: calculatedActionTypes.MULTIPLY, payload: 10 });
  };

  const divideHandler = () => {
    store.dispatch({ type: calculatedActionTypes.MULTIPLY, payload: 1 });
  };

  return (
    <main className={classes.counter}>
      <h1>Redux Counter</h1>
      <div className={classes.value}>Result: {result}</div>
      <button onClick={addHandler}>+</button>
      <button onClick={subtractHandler}>-</button>
      <button onClick={multiplyHandler}>*</button>
      <button onClick={divideHandler}>/</button>
    </main>
  );
};

export default Counter;
